import React from 'react';
import Banner from './banner.js';

/*
body, html {
	font-family: 'Open Sans', serif;
    font-size: 15px;
}
h1, h2, h3 {
	font-family: 'Raleway', sans-serif;
}
h2 {
	font-weight: 400;
	font-size: 38px;
	color: black;
	margin-top: 10px;
	margin-bottom: 15px;
}
h3 {
	font-size: 24px;
	font-weight: 400;
	color: black;
    margin: 0;
}
p {
	font-size: 15px;
}
*/

const tableStyle = function(x) { 
  return {
    borderCollapse: 'collapse',
    width: x
  };
};

var outerTableStyle = tableStyle('75%');
var innerTableStyle = tableStyle('100%');

function App() {
  return (
    <div className="App">
    <table style={outerTableStyle}>
    <tbody>
    <tr>
    <td>
    <table style={innerTableStyle}>
    <tbody>

      <Banner/>

    </tbody>
    </table>  
    </td>
    </tr>
    </tbody>
    </table>
    </div>
  );
}

export default App;
